import "./App.css";
import * as React from "react";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import SendIcon from "@mui/icons-material/Send";
import axios from "axios";

function handleFormSubmit() {
  var text = document.querySelector("#standard-basic").value;
  var formData = new FormData();
  formData.append("URL", text);
  var response = axios
    .post("http://127.0.0.1:8000/", formData)
    .then((response) => {
      console.log(response);
      var content = document.querySelector(".content");
      content.innerHTML = "<p>" + response.data.URL + "</p>";
    })
    .catch((error) => {
      console.error(error);
    });
}

function Footer({ name }) {
  return (
    <footer className="footer">
      Designed & Developed by {name} (2&#x2764;&#xfe0f;24) Sri Vasavi Engg.
      College
    </footer>
  );
}

function App() {
  return (
    <>
      <div className="container-fluid">
        <h1 className="title">PhishDefender</h1>
        <div className="content">
          <p>
            Think before you click!
            <br />
            We wish you're not going to be a victim...
          </p>
          <Stack direction="row" spacing={2}>
            <TextField
              name="url_input_tag"
              id="standard-basic"
              label="URL"
              variant="standard"
              style={{ width: "100%" }}
              onKeyDown={(e) => {
                if (e.key === "Enter") {
                  handleFormSubmit();
                }
              }}
            />
            <Button
              variant="contained"
              endIcon={<SendIcon />}
              style={{ maxHeight: "50%", padding: "0px 20px" }}
              color="primary"
              onClick={handleFormSubmit}
            >
              Submit
            </Button>
          </Stack>
        </div>
      </div>
      <Footer name={"Subhan Saheb Shaik"}></Footer>
    </>
  );
}

export default App;
